import React from "react";
import "./styles/App.css";
import "./styles/index.css";

function HomePage() {
  return (
    <div className="home-page">
      <header className="header">
        <h1>Website Wireframe</h1>
      </header>
      <main className="main-content">
        <div className="card">
          <div className="card-content">
            <h2>Your Graph Algorithm</h2>
            <button className="start-button" onClick={() => alert("Graph Algorithm Start")}>Start</button>
          </div>
        </div>
        <div className="card">
          <div className="card-content">
            <h2>Your Data Structure</h2>
            <button className="start-button" onClick={() => alert("Data Structure Start")}>Start</button>
          </div>
        </div>
      </main>
      <footer className="footer">
        <p>Internet of Things 2025</p>
      </footer>
    </div>
  );
}

export default HomePage;
